            };


            function builtPagination() {
                var pagination = $('.pagination');

                var itemsByPage = 50;
                var totalPages = ($('.IDX-resultsCount').text() * 1) / itemsByPage;

                $(pagination).append('<button class="btn " onclick="makePaginationPrevious()"><< <span class="display-pc">Previous</span></button>');
                var start = Math.max(window.bioCurrentPage - 1, 0);

                if (window.bioCurrentPage > 1 && totalPages > 5) {
                    pagination.append('<button class="btn btn-no-hover">...</button>');
                }

                for (var i = Math.min(start, totalPages - Math.min(totalPages, 5)); i <= start + 4 && i < totalPages; i++) {
                    pagination.append('<button class="btn ' + (i == window.bioCurrentPage ? "active" : "") + '" onclick="makePagination(' + i + ')">' + (i + 1) + '</button>');
                }

                if (window.bioCurrentPage + 4 < totalPages) {
                    if (!(window.bioCurrentPage == 0 && window.bioCurrentPage + 5 == totalPages))
                        pagination.append('<button class="btn btn-no-hover">...</button>');
                }
                pagination.append('<button class="btn" onclick="makePaginationNext()"><span class="display-pc">Next</span> >></button>');
            }

            builtPagination();

            var paginationTotal = $('.pagination-total');
            paginationTotal.append( $('.IDX-resultsCount').text() * 1 + ' found');
        });
    </script>
@endpush
